import React, {Component} from 'react';

class Board extends Component {
    render(){
        return(
            <div>
                <label>내용</label>
                <input type="text" placeholder="Context"/>
                <button>취소</button>
                <button>등록</button>
            </div>
        );
    }
}

export default Board;
